import{_ as i,o as s,c as r,b as t,e as a,d as e,a as d,r as l}from"../app.12f6dd38.mjs";const c="/datum-documentation/assets/\u5207\u6362\u7F51\u7EDC.d2b7d6f5.png",m="/datum-documentation/assets/\u9009\u62E9\u94B1\u5305.f7a595a6.png",p="/datum-documentation/assets/\u94B1\u5305\u767B\u5F55\u7B7E\u540D.0e7fce7f.png",h="/datum-documentation/assets/\u8BBE\u7F6E\u673A\u6784\u540D\u79F0.26c09b8b.png",u="/datum-documentation/assets/\u521D\u59CB\u5316\u8EAB\u4EFD\u6807\u8BC6.67a0b3c8.png",g="/datum-documentation/assets/\u8BBE\u7F6E\u673A\u6784\u5934\u50CF\u4E0E\u63CF\u8FF0.f631a081.png",f="/datum-documentation/assets/\u6CE8\u518C\u5165\u7F51.3cb21671.png",y="/datum-documentation/assets/\u7528\u6237\u4E2D\u5FC3-\u4E3B\u9875.d5dd7d05.png",b="/datum-documentation/assets/\u7528\u6237\u4E2D\u5FC3-\u7F51\u7EDC\u8EAB\u4EFD.b07bc43b.png",_="/datum-documentation/assets/\u7528\u6237\u4E2D\u5FC3-\u4FEE\u6539\u7BA1\u7406\u5458.14d7d2a3.png",w="/datum-documentation/assets/\u7CFB\u7EDF\u6982\u51B5.c8911b5b.png",k="/datum-documentation/assets/\u5F15\u5BFC\u8282\u70B9\u7BA1\u7406.d41b48e2.png",v="/datum-documentation/assets/\u6DFB\u52A0\u5F15\u5BFC\u8282\u70B9.6cf30b58.png",z="/datum-documentation/assets/\u5B58\u50A8\u8D44\u6E90\u7BA1\u7406.3558fd92.png",D="/datum-documentation/assets/\u8BA1\u7B97\u8D44\u6E90\u7BA1\u7406.6db55e9c.png",M="/datum-documentation/assets/\u542F\u52A8\u7B97\u529B.33f50221.png",C="/datum-documentation/assets/\u6DFB\u52A0\u6570\u636E.9efc696f.png",A="/datum-documentation/assets/\u6DFB\u52A0\u6570\u636E-2.60c232c0.png",N="/datum-documentation/assets/\u6570\u636E\u7BA1\u7406.8a2a475f.png",T="/datum-documentation/assets/\u53D1\u5E03\u51ED\u8BC1.236b20d4.png",P="/datum-documentation/assets/\u9009\u62E9\u5143\u6570\u636E.70c05389.png",S="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-1.0e317290.png",x="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-1.1.f4f6b4d1.png",O="/datum-documentation/assets/\u7ED1\u5B9A\u6570\u636E.5a36e3eb.png",I="/datum-documentation/assets/\u4FEE\u6539\u6D88\u8017\u91CF.1208254f.png",q="/datum-documentation/assets/\u8BBE\u7F6E\u5151\u6362\u4EF7\u683C.6716441f.png",E="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-2.baf38f0f.png",L="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-3.7819557a.png",F="/datum-documentation/assets/\u5BFC\u5165\u6D41\u52A8\u6027.8ad4bc75.png",U="/datum-documentation/assets/\u67E5\u770B\u6D41\u52A8\u6027.7f9e41fc.png",V="/datum-documentation/assets/\u7ED1\u5B9A\u6570\u636E-1.c7b370fc.png",B="/datum-documentation/assets/\u521B\u5EFA\u51ED\u8BC1.dda86cb6.png",R="/datum-documentation/assets/Metamask\u7B7E\u540D\u786E\u8BA4-4.1a149cb0.png",Y="/datum-documentation/assets/\u4E0A\u67B6.58497e24.png",j="/datum-documentation/assets/\u51ED\u8BC1\u8BE6\u60C5.edeb3467.png",H="/datum-documentation/assets/\u8BA1\u7B97\u4EFB\u52A1\u5217\u8868.a173b5f9.png",X="/datum-documentation/assets/\u8BA1\u7B97\u4EFB\u52A1\u8BE6\u60C5.9c71346a.png",W="/datum-documentation/assets/\u4EFB\u52A1\u65E5\u5FD7.338d8f6d.png",n="/datum-documentation/assets/\u7EC4\u7EC7\u7BA1\u7406-1.a355edd6.png",G="/datum-documentation/assets/\u63D0\u540D\u52A0\u5165\u59D4\u5458\u4F1A.776cb9a5.png",J="/datum-documentation/assets/\u63D0\u540D\u8E22\u51FA\u59D4\u5458\u4F1A.9ac635dd.png",K="/datum-documentation/assets/\u9000\u51FA\u59D4\u5458\u4F1A.2928b622.png",Q="/datum-documentation/assets/\u7533\u8BF7\u8BA4\u8BC1\u5BA1\u6279.c9f86744.png",Z="/datum-documentation/assets/\u63D0\u540D\u52A0\u5165\u63D0\u6848\u5F85\u529E\u5BA1\u6279.dd266a93.png",$="/datum-documentation/assets/\u67E5\u770B\u5185\u5BB9.9a491a2e.png",tt="/datum-documentation/assets/\u67E5\u770B\u5185\u5BB9-1.c608d93c.png",et="/datum-documentation/assets/\u64A4\u56DE\u63D0\u6848-1.439c4b8c.png",ot="/datum-documentation/assets/\u67E5\u770B\u5185\u5BB9-2.e6d42475.png",at="/datum-documentation/assets/\u7533\u8BF7\u8BA4\u8BC1.53328223.png",nt={},it={id:"datum-network-help-document-for-admins",tabindex:"-1"},st=t("a",{class:"header-anchor",href:"#datum-network-help-document-for-admins","aria-hidden":"true"},"#",-1),rt=e(),dt={href:"https://forum.latticex.foundation/t/topic/6334",target:"_blank",rel:"noopener noreferrer"},lt=e("Datum-network Help Document (for Admins)"),ct=t("p",null,"[TOC]",-1),mt=t("h2",{id:"overview",tabindex:"-1"},[t("a",{class:"header-anchor",href:"#overview","aria-hidden":"true"},"#"),e(),t("strong",null,"Overview")],-1),pt=t("p",null,"Datum-network is a distributed privacy computing network based on the underlying capabilities of privacy AI.",-1),ht=t("p",null,"Datum-network\u2019s console provides an interface through which data providers and computing power providers can manage raw data and computing resources.",-1),ut=t("p",null,"Users can deploy their Datum-network node locally to connect to the network. In addition, data providers can manage their data in a more reliable local environment, while computing power providers can share their computing power to improve the network\u2019s computing performance and earn profits.",-1),gt=t("p",null,"Here is how Datum-network nodes are deployed\uFF1Ahttps://github.com/datumtechs/datum-network-deploy/tree/ansible_v0.5.0",-1),ft=t("p",null,"For users\u2019 convenience, Datum-network offers five data sets that they can publish and use. Download link: Finance: http://testdownload.datumtechs.com/datum/dataset/Finance.zip Media Advertisement: http://testdownload.datumtechs.com/datum/dataset/MediaAdvertising.zip Medical & Health: http://testdownload.datumtechs.com/datum/dataset/Medicalhealth.zip Public Service: http://testdownload.datumtechs.com/datum/dataset/Publicservice.zip Transportation: http://testdownload.datumtechs.com/datum/dataset/Transportation.zip",-1),yt=e("Users can claim test tokens via the following address: "),bt={href:"https://faucet.platon.network/faucet/",target:"_blank",rel:"noopener noreferrer"},_t=e("PlatON"),wt=d('<h2 id="console-login" tabindex="-1"><a class="header-anchor" href="#console-login" aria-hidden="true">#</a> <strong>Console Login</strong></h2><p>After completing the node deployment, you will need to log in to Datum-platform to go through the connection settings.</p><p>You can directly log in to the console through MetaMask, without additional registration.</p><ol><li>Open the deployed console address in Chrome, and then enter the console homepage; click on [Metamask], and select [Switch Network] in the pop-up window to switch the network to the PlatON DevNet (development network).</li></ol><img src="'+c+'" alt="\u5207\u6362\u7F51\u7EDC" style="zoom:50%;"><ol start="2"><li>Once the network is switched to the PlatON DevNet, choose your account for the connection.</li></ol><img src="'+m+'" alt="\u9009\u62E9\u94B1\u5305" style="zoom:50%;"><ol start="3"><li>After the connection is confirmed, click on [Signature] and complete the authorization process to go to the console.</li></ol><img src="'+p+'" alt="\u94B1\u5305\u767B\u5F55\u7B7E\u540D" style="zoom:50%;"><h2 id="user-initialization" tabindex="-1"><a class="header-anchor" href="#user-initialization" aria-hidden="true">#</a> <strong>User Initialization</strong></h2><p><strong>1. Apply for Identity</strong></p><p>Once a node is deployed, the first user who logs in to the console will be able to initialize the node, and the user will become the administrator.</p><p>(1) Create the organization identity (to be displayed on the network), set the avatar of the organization, and fill in the organization profile.</p><img src="'+h+'" alt="\u8BBE\u7F6E\u673A\u6784\u540D\u79F0" style="zoom:50%;"><p>\uFF082\uFF09\u521D\u59CB\u5316\u8EAB\u4EFD\u6807\u8BC6(DID)\uFF0C\u8EAB\u4EFD\u6807\u8BC6(did)\u662F\u53BB\u4E2D\u5FC3\u5316\u7684\u8EAB\u4EFD\u7528\u6237, \u7528\u4E8E\u9879\u76EE\u4E2D\u7684\u6570\u636E\u8D44\u4EA7\u5316,\u5DE5\u4F5C\u6D41\u8FD0\u884C,\u6E05\u7B97\u7B49\u591A\u4E2A\u73AF\u8282. \u800C\u521D\u59CB\u5316\u8EAB\u4EFD\u6807\u8BC6\u9700\u8981\u5185\u7F6E\u7BA1\u7406\u5458\u94B1\u5305\u652F\u4ED8\u4E00\u5B9A\u7684\u624B\u7EED\u8D39, \u8BF7\u786E\u4FDD\u521D\u59CB\u5316\u8EAB\u4EFD\u6807\u8BC6\u524D\u94B1\u5305\u6709\u4E00\u5B9A\u7684\u4F59\u989D\u3002</p><p>(2) DID Initialization: Decentralized identity (DID) is required by multiple processes, covering data tokenization, workflow operation, liquidation, etc. To initialize the DID, you&#39;ll need to pay a fee through the built-in admin wallet. Please make sure that you have sufficient balance before initializing your DID.</p><img src="'+u+'" alt="\u521D\u59CB\u5316\u8EAB\u4EFD\u6807\u8BC6" style="zoom:50%;"><p>\uFF083\uFF09\u8BBE\u7F6E\u673A\u6784\u5934\u50CF\u3001\u586B\u5199\u673A\u6784\u63CF\u8FF0\u3002</p><p>(3) Set the organization icon and fill in the organization intro.</p><img src="'+g+'" alt="\u8BBE\u7F6E\u673A\u6784\u5934\u50CF\u4E0E\u63CF\u8FF0" style="zoom:50%;"><p>\uFF084\uFF09Get registered to connect to the network, and then complete the initialization settings.</p><p>Upon successful initialization, the system will automatically generate a built-in wallet address, which will be used to pay service fees for the execution of computing tasks.</p><img src="'+f+'" alt="\u6CE8\u518C\u5165\u7F51" style="zoom:50%;"><p><strong>2. User Center (available only to admins)</strong></p><p>Upon successful initialization, administrators can click on the upper right corner to log in to their accounts and view the relevant node information, including connection status and address information. Admins can also modify the management address and check the built-in wallet and its balance.</p><p>(1) Organization information.</p><img src="'+y+'" alt="\u7528\u6237\u4E2D\u5FC3-\u4E3B\u9875" style="zoom:50%;"><p>(2) Connection status.</p><img src="'+b+'" alt="\u7528\u6237\u4E2D\u5FC3-\u7F51\u7EDC\u8EAB\u4EFD" style="zoom:50%;"><p>(3) Change admin, and check the built-in wallet.</p><img src="'+_+'" alt="\u7528\u6237\u4E2D\u5FC3-\u4FEE\u6539\u7BA1\u7406\u5458" style="zoom:50%;"><h2 id="overview-of-the-console" tabindex="-1"><a class="header-anchor" href="#overview-of-the-console" aria-hidden="true">#</a> <strong>Overview of the Console</strong></h2><p>The console shows the system resources of the connected node, including CPU, memory, bandwidth, and fee consumption, as well as the tasks performed by the node, which covers the amount of data published and the overview of computing tasks.</p><img src="'+w+'" alt="\u7CFB\u7EDF\u6982\u51B5" style="zoom:50%;"><h2 id="node-management-available-only-to-admins" tabindex="-1"><a class="header-anchor" href="#node-management-available-only-to-admins" aria-hidden="true">#</a> <strong>Node Management (available only to admins)</strong></h2><p><strong>1. Boot Node Management</strong></p><p>Datum-network\u2019s new nodes need to connect to a boot node to be discovered by other participants in the network.</p><p>When you initialize and register a node, by default, the system will connect it to an initial seed node (the default boot node). You can always go to [Node Management] - [Boot node Management] to update, maintain, or replace the default boot node.</p><p>(1) Boot node management page</p><p>Click on [Node Management] - [Boot node Management] to enter the management page.</p><img src="'+k+'" alt="\u5F15\u5BFC\u8282\u70B9\u7BA1\u7406" style="zoom:50%;"><p>(2) Add or delete boot nodes</p><p>Click on [Add a new Boot node] and enter the ID to add a new bootnode.</p><p>You can [Delete] a bootnode if you would like to.</p><img src="'+v+'" alt="\u6DFB\u52A0\u5F15\u5BFC\u8282\u70B9" style="zoom:50%;"><p><strong>2. Storage Resource Management</strong></p><p>If you want to be a data provider and publish metadata and creat credentials via local services, you will first have to add \u201CStorage Resource\u201D in the console as a path for managing raw data and publishing metadata.</p><p>Click on [Node Management] - [Storage Resource Management] to open the management page.</p><img src="'+z+'" alt="\u5B58\u50A8\u8D44\u6E90\u7BA1\u7406" style="zoom:50%;"><p><strong>3. Computing Resource Management</strong></p><p>If you want to be a computing power provider and offer Datum computing resources, you\u2019ll need to configure \u201CComputing Resource\u201D via the console.</p><p>Click on [Node Management] - [Computing Resource Management] to open the resource management page.</p><p>The default status of computing resources is \u201CDisable\u201D, and you can enable, disable, or rename the resources by clicking on the buttons under the [Actions] column.</p><p>After the computing resources become enabled, the system will schedule your computing resources according to the privacy computing tasks initiated by participants in the network.</p><img src="'+D+'" alt="\u8BA1\u7B97\u8D44\u6E90\u7BA1\u7406" style="zoom:50%;"><img src="'+M+'" alt="\u542F\u52A8\u7B97\u529B" style="zoom:50%;"><h2 id="my-data" tabindex="-1"><a class="header-anchor" href="#my-data" aria-hidden="true">#</a> <strong>My Data</strong></h2><p>Through \u201CMy Data\u201D, you can manage the original data to be capitalized. For instance, you can add/extract metadata (data information that can be publicly displayed) and issue credentials.</p><p><strong>[Data Addition]</strong></p><p>(1) Click on [My Data] - [Data Addition] to go to the page for adding data and extracting metadata.</p><img src="'+C+'" alt="\u6DFB\u52A0\u6570\u636E" style="zoom:50%;"><p>\uFF082\uFF09Select the local data file to be used (only CSV files are supported at the moment), then click on [Upload]. The system will automatically read the \u201CField\u201D and \u201CData Type\u201D contained in the original data, collectively referred to as metadata. Users can modify the usage scenarios: private computing, non private computing (data can only be used in the selected algorithm (private computing/non private computing), and multiple choices are supported), as well as the metadata information read, and select &quot;Visible to the public&quot;.</p><img src="'+A+'" alt="\u6DFB\u52A0\u6570\u636E-2" style="zoom:50%;"><p>\uFF083\uFF09After the basic information and field information are filled in and confirmed, you should then click on [Submit] at the bottom of the page to upload the metadata to the present node and enter the [Data Management] module.</p><p><strong>[Data Management]</strong></p><p>You can publish metadata and manage your data through [My Data] - [Data Management].</p><img src="'+N+'" alt="\u6570\u636E\u7BA1\u7406" style="zoom:50%;"><ul><li>Metadata added through [Data Addition] will appear as \u201CUnpublished\u201D by default. After clicking on [Publish Data], the metadata will be published on Datum-platform\u2019s data market and become available to other participants. Meanwhile, its status will be changed to \u201CPublish Data\u201D.</li><li>Click on [View] to view the metadata details.</li><li>Click on [Download] to download the data uploaded to the present node to your device.</li><li>Click on [SaveAsNewData] to add a new piece of data to the node based on the published metadata. You can change the display information of the metadata before publishing.</li><li>Click on [Publish data credential] to issue Data Token based on your data.</li></ul><p><strong>[Publish Data Credential]</strong></p><p>(1) Go to [My Data] - [Publish data credential] to set the token parameters, including type, basic information, and total circulation.</p><p>You can also click on \u201CPublish data credential\u201D in [Data Management] to go to the page</p><img src="'+T+'" alt="\u53D1\u5E03\u51ED\u8BC1" style="zoom:50%;"><p>\uFF082\uFF09Select the type of credential to be issued: \u201CNo Attribute Credentials\u201D are ERC-20 assets, while \u201CAttributed Credentials\u201D are NFTs.</p><img src="'+P+'" alt="\u9009\u62E9\u5143\u6570\u636E" style="zoom:50%;"><p>\uFF083.1\uFF09<strong>Mint No-Attribute Credentials</strong>: After selecting the data for the issuance of your Data Token, go to the [No-attribute Credential] information setting page to set the name, symbol, total circulation, and description of the credential.</p><ul><li>\u201CName\u201D: the name of the credential seen in Datum-platform\u2019s data market.</li><li>\u201CSymbol\u201D: the symbol of the credential on the DEX.</li><li>\u201CCirculation\u201D: the total amount that can be purchased by other users. Each Credential represents the right to use the corresponding data once.</li></ul><p>After the relevant information is entered, click on [Publish Credential], complete signification confirmation for the transaction via Metamask to mint the credential</p><img src="'+S+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-1" style="zoom:50%;"><p>\uFF083.2\uFF09<strong>Mint Attribute Credentials</strong>: After selecting the data for the issuance of your Data Token, go to the [Attribute Credential] information setting page to set the name and symbol of the credential.</p><ul><li>\u201CName\u201D: the name of the credential seen in Datum-platform\u2019s data market.</li><li>\u201CSymbol\u201D: the symbol of the credential on the trading market.</li></ul><p>After the relevant information is entered, click on [Publish Credential], and complete signification confirmation for the transaction via Metamask to mint the credential.</p><img src="'+x+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-1" style="zoom:50%;"><h2 id="my-credential" tabindex="-1"><a class="header-anchor" href="#my-credential" aria-hidden="true">#</a> <strong>My Credential</strong></h2><p><strong>[No Attribute Credential]</strong></p><ol><li><p>Click on [My Credential] - [No Attribute Credential] to view and manage the credentials you published.</p><p>\u6570\u636E\u8D44\u4EA7\u51ED\u8BC1\u94F8\u9020\u5B8C\u6210\u540E\uFF0C\u9700\u8981\u5BF9\u5176\u7ED1\u5B9A\u6570\u636E\uFF0C\u5B8C\u6210\u6570\u636E\u7ED1\u5B9A\u540E\uFF0C\u53EF\u4EE5\u5BF9\u51ED\u8BC1\u5408\u7EA6\u8FDB\u884C\u5B9A\u4EF7\u4EE5\u53CA\u4FEE\u6539\u5BF9\u5E94\u7684\u4F7F\u7528\u573A\u666F\u6D88\u8017\u91CF\uFF0C\u8BE5\u503C\u6BCF24h\u5185\u53EA\u80FD\u4FEE\u6539\u4E00\u6B21\u3002</p><p>Once a credential is minted, you should bind it with data, after which you\u2019ll be able to price the credential contract and adjust the consumption amount for the corresponding application scenario. The consumption amount can only be adjusted once every 24 hours.</p><p>\uFF081\uFF09Data binding</p><img src="'+O+'" alt="\u7ED1\u5B9A\u6570\u636E" style="zoom:50%;"><p>\uFF082\uFF09Adjust consumption amout</p><img src="'+I+'" alt="\u4FEE\u6539\u6D88\u8017\u91CF" style="zoom:50%;"><p>\uFF083\uFF09Set initial price</p><p>After the credential is minted, you\u2019ll need to set the first price and provide liquidity for the DEX to complete the initial issuance.</p><p>Data Tokens will form trading pairs with LAT as the reference price.</p><img src="'+q+'" alt="\u8BBE\u7F6E\u5151\u6362\u4EF7\u683C" style="zoom:50%;"><p>After setting the first price, click on [Launch to marketplace], offer access authorization via Metamask, complete signature confirmation, and then provide liquidity of the token for the DEX.</p><img src="'+E+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-2" style="zoom:50%;"><img src="'+L+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-3" style="zoom:50%;"></li><li><p>Priced credentials with liquidity added are available on the DEX https://test.dipoleswap.exchange/</p></li></ol><p>\u200B (1) First, confirm the importation of the Token.</p><img src="'+F+'" alt="\u5BFC\u5165\u6D41\u52A8\u6027" style="zoom:50%;"><p>\u200B \uFF082\uFF09You can check the added Token via the Swap page on the DEX and purchase the Token through Swap or adjust the Token\u2019s liquidity.</p><img src="'+U+'" alt="\u67E5\u770B\u6D41\u52A8\u6027" style="zoom:50%;"><p><strong>[Attribute Credential]</strong></p><p>\u200B 1.Click on [My Credential] - [Attribute Credential] to view and manage the credentials you published.</p><p>\u200B \u6570\u636E\u8D44\u4EA7\u51ED\u8BC1\u94F8\u9020\u5B8C\u6210\u540E\uFF0C\u9700\u8981\u5BF9\u5176\u7ED1\u5B9A\u6570\u636E\uFF0C\u5B8C\u6210\u6570\u636E\u7ED1\u5B9A\u540E\uFF0C\u53EF\u4EE5\u5BF9\u51ED\u8BC1\u5408\u7EA6\u521B\u5EFA\u51ED\u8BC1\u3002</p><p>Once a credential is minted, you should then bind it with data, after which you\u2019ll be able to create credentials for the credential contract.</p><p>\u200B \uFF081\uFF09Data binding</p><img src="'+V+'" alt="\u7ED1\u5B9A\u6570\u636E-1" style="zoom:50%;"><p>\uFF082\uFF09Creat Credential</p><ul><li>\u201CName\u201D: the name of the credential seen in Datum-platform\u2019s data market.</li><li>\u201CExpire Date\u201D: the validity period of the credential.</li><li>&quot;Usage Scenarios&quot;: the computation types that the credentials can support.</li></ul><img src="'+B+'" alt="\u521B\u5EFA\u51ED\u8BC1" style="zoom:50%;"><p>After setting the relevant information, click on [Creat Credential], complete signification confirmation for the transaction via Metamask to accomplish the credential.</p><img src="'+R+'" alt="Metamask\u7B7E\u540D\u786E\u8BA4-4" style="zoom:50%;"><p>\uFF083\uFF09Launch</p><p>Click [Launch] button in Attribute Credential page, and choose a NFT market to launch the NFT.</p><p><img src="'+Y+'" alt="NFT\u4E0A\u67B6"></p><p>\uFF084\uFF09Details</p><p>Click [Detail] button in Attribute Credential page to see the detailed information.</p><img src="'+j+'" alt="\u51ED\u8BC1\u8BE6\u60C5" style="zoom:50%;"><h2 id="computing-tasks-available-only-to-admins" tabindex="-1"><a class="header-anchor" href="#computing-tasks-available-only-to-admins" aria-hidden="true">#</a> <strong>Computing Tasks (available only to admins)</strong></h2><p>Through \u201CComputing Tasks\u201D, the admin can view the privacy computing tasks performed by the present node.</p><p>Admins can click on [Computing Tasks] to check the list of computing tasks and their status.</p><img src="'+H+'" alt="\u8BA1\u7B97\u4EFB\u52A1\u5217\u8868" style="zoom:50%;"><p>Admins may choose any computing task and click on [View Detail] to go to the Task Details page.</p><img src="'+X+'" alt="\u8BA1\u7B97\u4EFB\u52A1\u8BE6\u60C5" style="zoom:50%;"><p>Admins may choose any computing task and click on [View Log] to go to the log page.</p><img src="'+W+'" alt="\u4EFB\u52A1\u65E5\u5FD7" style="zoom:50%;"><h2 id="organization-management-available-only-to-admins" tabindex="-1"><a class="header-anchor" href="#organization-management-available-only-to-admins" aria-hidden="true">#</a> Organization Management (available only to admins)</h2><p><strong>\u3010Members of the Management Committee\u3011</strong></p><p>Members of the Management Committee may nominate new members, propose the removal of existing members, apply for certification review, and withdraw from the committee.</p><p>Click on [Organization Management] to manage your organization.</p><img src="'+n+'" alt="\u7EC4\u7EC7\u7BA1\u7406-1" style="zoom:50%;"><p>(1) Nominate new members</p><p>Members of the committee can nominate new members. A nomination proposal would only be passed if enough members of the committee voted for it. To initiate a nomination proposal, you should click on [Nomination of Members] on the Organization Management page and enter the Nomination page.</p><p>Select the organization in the \u201CSelect Organization\u201D dropdown list, which shows all organizations that are not members of the committee.</p><p>Enter the organization\u2019s IP in \u201CSelected Organization IP\u201D.</p><p>Fill in the corresponding port in \u201CSelected Organization Port\u201D.</p><img src="'+G+'" alt="\u63D0\u540D\u52A0\u5165\u59D4\u5458\u4F1A" style="zoom:50%;"><p>(2) Propose the removal of members</p><p>A member of the committee may propose the removal of other members (other than the original members and itself). A removal proposal would only be passed if enough members of the committee voted for it. To initiate a removal proposal, you should click on [Nominations kicked out of the Committee] on the Organization Management page and enter the corresponding page.</p><img src="'+J+'" alt="\u63D0\u540D\u8E22\u51FA\u59D4\u5458\u4F1A" style="zoom:50%;"><p>(3) Withdraw from the committee</p><p>Members other than the original members may click on [Withdraw Committee] and [Confirm] to make a withdrawal proposal, which does not require voting. During the 12-hour cooling-off period, the proposal can be revoked; the proposal will become valid once the cooling-off period is finished.</p><img src="'+K+'" alt="\u9000\u51FA\u59D4\u5458\u4F1A" style="zoom:50%;"><p>(4) Committee Affairs: My To-Do List. In My To-Do List, you can vote on nomination proposals and removal proposals and review the certification applications initiated by organizations.</p><p>Certification applications to be processed:</p><img src="'+Q+'" alt="\u7533\u8BF7\u8BA4\u8BC1\u5BA1\u6279" style="zoom:50%;"><p>Nomination proposals to be processed:</p><img src="'+Z+'" alt="\u63D0\u540D\u52A0\u5165\u63D0\u6848\u5F85\u529E\u5BA1\u6279" style="zoom:50%;"><p>Proposal details:</p><img src="'+$+'" alt="\u67E5\u770B\u5185\u5BB9" style="zoom:50%;"><p>(5) Committee Affairs: My Done List. In My Done List, you can view the nomination proposals, removal proposals, and certification reviews that you&#39;ve processed.</p><p>Details of affairs done</p><img src="'+tt+'" alt="\u67E5\u770B\u5185\u5BB9-1" style="zoom:50%;"><p>(6) Committee Affairs: My Proposal. The \u201CMy Proposal\u201D list shows all the proposals you initiated; proposals within the cooling-off period can be revoked.</p><img src="'+et+'" alt="\u64A4\u56DE\u63D0\u6848-1" style="zoom:50%;"><p>Proposal details (not covered within the cooling-off period)</p><img src="'+ot+'" alt="\u67E5\u770B\u5185\u5BB9-2" style="zoom:50%;"><p>[Regular Organization]</p><p>A regular organization can join the committee through nomination proposals or apply for certification and become a certified organization on the Organization Management page.</p><p>Click on [Organization Management] to manage your organization.</p><img src="'+n+'" alt="\u7EC4\u7EC7\u7BA1\u7406-1" style="zoom:50%;"><p>Apply for certification: Select a node to review your application, and fill in the required information. Once the selected node approves your application, your organization will become a certified organization.</p><img src="'+at+'" alt="\u7533\u8BF7\u8BA4\u8BC1" style="zoom:50%;">',151);function kt(vt,zt){const o=l("ExternalLinkIcon");return s(),r("div",null,[t("h1",it,[st,rt,t("a",dt,[lt,a(o)])]),ct,mt,pt,ht,ut,gt,ft,t("p",null,[yt,t("a",bt,[_t,a(o)])]),wt])}const Mt=i(nt,[["render",kt],["__file","Datum-network-Help-Document(Admins).html.vue"]]);export{Mt as default};
